import React from 'react';
import s from './order_Shop.module.css'
import Buy_subscription from './buy_subscription/buy_subscription';

import {  Route } from 'react-router-dom';//**** */
import { NavLink } from 'react-router-dom';//**** */
import Test2 from './test/test2';//**** */

const Order_Shoop_menu = (props) =>{
    let path = "/Order_shoop/" + props.path;
    return(
        <NavLink className={props.clas_e} to={path}><div>{props.name}</div></NavLink>
    )
}

const Order_Shoop = () => {
    return (
        <div className={s.grid}>
            <div className={s.grid1}>
                <div className={s.nav_grid}>
                    <Order_Shoop_menu clas_e={s.nav1} path="Buy_subscription" name="Заказ" />
                    <Order_Shoop_menu clas_e={s.nav2} path="test2" name="БД" />
                    
                    <div className={s.nav3}>КК</div>
                    <div className={s.nav4}>Оформление</div>
                    <div className={s.nav5}>Контакты</div>                    
                    <div className={s.nav6}>Время работы</div>
                    <div className={s.nav7}>Буквы</div> 
                </div>
            </div>
            <div className={s.grid2}></div>
            <div className={s.grid3}>
                    <Route path="/Order_shoop/Buy_subscription" component={Buy_subscription} />
                    <Route path="/Order_shoop/test2" component={Test2} />
            </div>
        </div>
    )
}
export default Order_Shoop;
